CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `view_proveedor_con_deuda` AS select `proveedor_cuenta_corriente`.`ccte_id` AS `ccte_id`,`proveedor_cuenta_corriente`.`ccte_proveedor_id` AS `ccte_proveedor_id`,`proveedor_cuenta_corriente`.`ccte_fh` AS `ccte_fh`,`proveedor_cuenta_corriente`.`ccte_operacion_tipo` AS `ccte_operacion_tipo`,`proveedor_cuenta_corriente`.`ccte_operacion_id` AS `ccte_operacion_id`,`proveedor_cuenta_corriente`.`ccte_importe` AS `ccte_importe`,`proveedor_cuenta_corriente`.`ccte_saldo_actual` AS `ccte_saldo_actual`,`proveedor`.`prov_id` AS `prov_id`,`proveedor`.`prov_nombre` AS `prov_nombre`,`proveedor`.`prov_email` AS `prov_email`,`proveedor`.`prov_tel1` AS `prov_tel1`,`proveedor`.`prov_dni` AS `prov_dni`,`proveedor`.`prov_observacion` AS `prov_observacion`,`proveedor`.`prov_direccion` AS `prov_direccion`,`proveedor`.`prov_fh_alta` AS `prov_fh_alta`,`proveedor`.`prov_baja` AS `prov_baja` from (`proveedor_cuenta_corriente` join `proveedor` on((`proveedor_cuenta_corriente`.`ccte_proveedor_id` = `proveedor`.`prov_id`))) where (`proveedor_cuenta_corriente`.`ccte_id` in (select max(`proveedor_cuenta_corriente`.`ccte_id`) AS `id` from `proveedor_cuenta_corriente` group by `proveedor_cuenta_corriente`.`ccte_proveedor_id`) and (`proveedor_cuenta_corriente`.`ccte_saldo_actual` < 0) and (`proveedor`.`prov_baja` = 0)) order by `proveedor_cuenta_corriente`.`ccte_saldo_actual` desc ;

