CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `view_reporte_lotes` AS select `producto_stock`.`ps_id` AS `ID`,if(`producto_stock`.`ps_compra_id`,'COMPRA','TRANSFERENCIA') AS `ORIGEN`,if(`producto_stock`.`ps_compra_id`,`proveedor`.`prov_nombre`,convert(`puesto`.`puesto_nombre` using utf8)) AS `PROVEEDOR`,if(`producto_stock`.`ps_compra_id`,`compra`.`compra_fh`,'') AS `FECHA_COMPRA`,if(`producto_stock`.`ps_transf_id`,`transferencias`.`transf_fh`,'') AS `FECHA_TRANSF`,`tipo`.`tipo_nombre` AS `CATEGORIA`,`categoria`.`cat_nombre` AS `PRODUCTO`,`producto`.`prod_alias` AS `VARIEDAD`,`producto_stock`.`ps_calibre` AS `CALIBRE`,`producto_stock`.`ps_cantidad_ingresada` AS `CANTIDAD`,if(`producto_stock`.`ps_compra_id`,`compra_detalle`.`detalle_prod_precio_u`,`producto_stock`.`ps_costo_u`) AS `VALOR_U`,`descarga_detalle`.`detalle_descarga_costo` AS `DESCARGA_U`,`carga_detalle`.`detalle_carga_costo` AS `CARGA_U`,`flete_detalle`.`detalle_prod_costo_u` AS `FLETE_U`,`producto_stock`.`ps_precio_prom_venta` AS `PPV`,`producto_stock`.`ps_precio_prom_venta_fh` AS `PPV_FH`,if(`producto_stock`.`ps_compra_id`,`compra`.`compra_transp_id`,if(`transferencias`.`transf_transp`,`transferencias`.`transf_transp`,`transferencias`.`transf_transp_origen`)) AS `TRANSPORTISTA` from ((((((((((((`producto_stock` left join `compra` on((`compra`.`compra_id` = `producto_stock`.`ps_compra_id`))) left join `compra_detalle` on((`compra_detalle`.`detalle_ps_id` = `producto_stock`.`ps_id`))) left join `transferencias` on((`transferencias`.`transf_id` = `producto_stock`.`ps_transf_id`))) left join `proveedor` on((`compra`.`compra_prov_id` = `proveedor`.`prov_id`))) left join `puesto` on((`puesto`.`puesto_id` = `transferencias`.`transf_origen`))) left join `transportista` on((`transferencias`.`transf_transp` = `transportista`.`transportista_id`))) left join `producto` on((`producto`.`prod_id` = `producto_stock`.`ps_producto_id`))) left join `categoria` on((`categoria`.`cat_id` = `producto`.`prod_cat_id`))) left join `tipo` on((`tipo`.`tipo_id` = `categoria`.`cat_tipo_id`))) left join `carga_detalle` on((`carga_detalle`.`detalle_ps_id` = `producto_stock`.`ps_id`))) left join `descarga_detalle` on((`descarga_detalle`.`detalle_ps_id` = `producto_stock`.`ps_id`))) left join `flete_detalle` on((`flete_detalle`.`detalle_ps_id` = `producto_stock`.`ps_id`))) order by `producto_stock`.`ps_id` ;

