CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `view_reporte_transferencias` AS select concat('TR00',`transferencias`.`transf_id`) AS `ID`,`transferencias`.`transf_matriz_id` AS `MATRIZ_ID`,if((`transferencia_estado`.`te_id` in (4,5)),`producto_stock`.`ps_lote`,'SIN LOTE') AS `LOTE_COMPUESTO`,`transferencias`.`transf_fh` AS `FECHA`,`transferencias`.`transf_origen` AS `ORIGEN`,`transferencias`.`transf_destino` AS `DESTINO`,`transferencias`.`transf_numero_viaje` AS `NUMERO_VIAJE`,`transportista`.`transportista_nombre` AS `TRANSPORTISTA`,`tipo`.`tipo_nombre` AS `CATEGORIA`,`categoria`.`cat_nombre` AS `PRODUCTO`,`producto`.`prod_alias` AS `VARIEDAD`,if((`transferencia_estado`.`te_id` in (4,5)),`producto_stock`.`ps_calibre`,`transferencias_detalle`.`detalle_calibre`) AS `CALIBRE`,if((`transferencia_estado`.`te_id` in (4,5)),`producto_stock`.`ps_id`,'SIN LOTE') AS `LOTE`,`transferencias_detalle`.`detalle_producto_cantidad_origen` AS `CANTIDAD_ORIGEN`,`transferencias_detalle`.`detalle_producto_cantidad_destino` AS `CANTIDAD_DESTINO`,if((`transferencia_estado`.`te_id` in (4,5)),`producto_stock`.`ps_costo_u`,`transferencias_detalle`.`detalle_costo_unitario`) AS `VALOR`,`transferencias_detalle`.`detalle_costo_carga` AS `CARGA`,`transferencias_detalle`.`detalle_costo_descarga` AS `DESCARGA`,`transferencias_detalle`.`detalle_costo_flete_origen` AS `FLETE_ORIGEN`,`transferencias_detalle`.`detalle_costo_flete_destino` AS `FLETE_DESTINO`,if((`transferencia_estado`.`te_id` in (4,5)),`producto_stock`.`ps_precio_prom_venta`,'-') AS `PPV`,`transferencia_estado`.`te_desc` AS `ESTADO`,`transferencias`.`transf_obs` AS `OBS` from (((((((`transferencias` left join `transferencia_estado` on((`transferencia_estado`.`te_id` = `transferencias`.`transf_estado`))) left join `transferencias_detalle` on((`transferencias_detalle`.`detalle_transferencia_id` = `transferencias`.`transf_id`))) left join `transportista` on((`transferencias`.`transf_transp` = `transportista`.`transportista_id`))) left join `producto` on((`producto`.`prod_id` = `transferencias_detalle`.`detalle_producto_id`))) left join `categoria` on((`categoria`.`cat_id` = `producto`.`prod_cat_id`))) left join `tipo` on((`tipo`.`tipo_id` = `categoria`.`cat_tipo_id`))) left join `producto_stock` on((`producto_stock`.`ps_id` = `transferencias_detalle`.`detalle_lote`))) order by `transferencias`.`transf_id`,`transferencias_detalle`.`detalle_id` ;

