-- View structure for `view_salidas_de_caja`
-- ----------------------------
DROP VIEW IF EXISTS `view_salidas_de_caja`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `view_salidas_de_caja` AS (select 'Proveedores' AS `categoria`,concat('Pago a <b>',`proveedor`.`prov_nombre`,'</b> - ',convert(`forma_pago`.`fp_desc` using utf8)) AS `concepto`,`pago_proveedor`.`pago_fh` AS `fecha`,`proveedor`.`prov_nombre` AS `nombre`,`pago_proveedor`.`pago_monto_total` AS `monto`,`pago_proveedor`.`pago_observacion` AS `observacion`,`pago_proveedor`.`pago_id` AS `id`,`forma_pago`.`fp_desc` AS `forma_pago`,concat('PP',`pago_proveedor`.`pago_id`) AS `op_id`,`forma_pago`.`fp_id` AS `fp_id` from (((`pago_proveedor` join `usuario` on((`usuario`.`usua_id` = `pago_proveedor`.`pago_usuario_id`))) left join `proveedor` on((`proveedor`.`prov_id` = `pago_proveedor`.`pago_prov_id`))) join `forma_pago` on((`forma_pago`.`fp_id` = `pago_proveedor`.`pago_forma_pago`)))) union (select 'Transportistas' AS `categoria`,concat('Pago a <b>',`transportista`.`transportista_nombre`,'</b> - ',convert(`forma_pago`.`fp_desc` using utf8)) AS `concepto`,`pago_transportista`.`pago_fh` AS `fecha`,`transportista`.`transportista_nombre` AS `nombre`,`pago_transportista`.`pago_monto_total` AS `monto`,`pago_transportista`.`pago_observacion` AS `observacion`,`pago_transportista`.`pago_id` AS `id`,`forma_pago`.`fp_desc` AS `forma_pago`,concat('PT',`pago_transportista`.`pago_id`) AS `op_id`,`forma_pago`.`fp_id` AS `fp_id` from (((`pago_transportista` join `forma_pago` on((`forma_pago`.`fp_id` = `pago_transportista`.`pago_forma_pago`))) join `usuario` on((`usuario`.`usua_id` = `pago_transportista`.`pago_usuario_id`))) join `transportista` on((`transportista`.`transportista_id` = `pago_transportista`.`pago_transp_id`)))) union (select 'Entrega Empleado' AS `categoria`,concat('Pago a empleado ',`pago_empleado`.`pago_id`,' a <b>',`empleado`.`empleado_nombre`,'</b> por ',convert(`forma_pago`.`fp_desc` using utf8),' - ') AS `concepto`,`pago_empleado`.`pago_fh` AS `fecha`,`empleado`.`empleado_nombre` AS `nombre`,`pago_empleado`.`pago_monto_total` AS `monto`,`pago_empleado`.`pago_observacion` AS `observacion`,`pago_empleado`.`pago_id` AS `id`,`forma_pago`.`fp_desc` AS `forma_pago`,concat('EE',`pago_empleado`.`pago_id`) AS `op_id`,`forma_pago`.`fp_id` AS `fp_id` from (((`pago_empleado` join `usuario` on((`usuario`.`usua_id` = `pago_empleado`.`pago_usuario_id`))) join `empleado` on((`empleado`.`empleado_id` = `pago_empleado`.`pago_emplead_id`))) join `forma_pago` on((`forma_pago`.`fp_id` = `pago_empleado`.`pago_forma_pago`)))) union (select 'Carga/Descarga' AS `categoria`,concat('Pago a Carga/Descarga ',`pago_cardesc`.`pago_id`,' a <b>',convert(`cardesc`.`cardesc_nombre` using utf8),'</b> por ',convert(`forma_pago`.`fp_desc` using utf8),' - ') AS `concepto`,`pago_cardesc`.`pago_fh` AS `fecha`,`cardesc`.`cardesc_nombre` AS `nombre`,`pago_cardesc`.`pago_monto_total` AS `monto`,`pago_cardesc`.`pago_observacion` AS `observacion`,`pago_cardesc`.`pago_id` AS `id`,`forma_pago`.`fp_desc` AS `forma_pago`,concat('CD',`pago_cardesc`.`pago_id`) AS `op_id`,`forma_pago`.`fp_id` AS `fp_id` from (((`pago_cardesc` join `usuario` on((`usuario`.`usua_id` = `pago_cardesc`.`pago_usuario_id`))) left join `cardesc` on((`cardesc`.`cardesc_id` = `pago_cardesc`.`pago_cardesc_id`))) join `forma_pago` on((`forma_pago`.`fp_id` = `pago_cardesc`.`pago_forma_pago`)))) union (select `gasto_categoria`.`gc_desc` AS `categoria`,concat('Gasto ',`gasto`.`gasto_id`,' por <b>',`gasto`.`gasto_concepto`,'</b>',' - ') AS `concepto`,`gasto`.`gasto_fh` AS `fecha`,`gasto`.`gasto_concepto` AS `nombre`,`gasto`.`gasto_monto_total` AS `monto`,`gasto`.`gasto_observacion` AS `observacion`,`gasto`.`gasto_id` AS `id`,'Efectivo' AS `forma_pago`,concat('GA',`gasto`.`gasto_id`) AS `op_id`,'1' AS `fp_id` from ((`gasto` join `gasto_categoria` on((`gasto`.`gasto_categoria` = `gasto_categoria`.`gc_id`))) join `usuario` on((`usuario`.`usua_id` = `gasto`.`gasto_usuario_id`)))) union (select 'Banco' AS `categoria`,concat('A banco por cobro ',`cobro_cliente`.`cobro_id`,' a <b>',`cliente`.`cliente_nombre`,'</b> por ',convert(`forma_pago`.`fp_desc` using utf8),' - ') AS `concepto`,`cobro_cliente`.`cobro_fh` AS `fecha`,`cliente`.`cliente_nombre` AS `nombre`,`cobro_cliente`.`cobro_monto_total` AS `monto`,`cobro_cliente`.`cobro_observacion` AS `observacion`,`cobro_cliente`.`cobro_id` AS `id`,`forma_pago`.`fp_desc` AS `forma_pago`,concat('BA',`cobro_cliente`.`cobro_id`) AS `op_id`,`forma_pago`.`fp_id` AS `fp_id` from ((((`cobro_cliente` join `usuario` on((`usuario`.`usua_id` = `cobro_cliente`.`cobro_usuario_id`))) join `cliente` on((`cliente`.`cliente_id` = `cobro_cliente`.`cobro_cliente_id`))) join `forma_pago` on((`forma_pago`.`fp_id` = `cobro_cliente`.`cobro_forma_pago`))) left join `cheque` on((`cheque`.`cheque_id` = `cobro_cliente`.`cobro_cheque_id`))) where ((`forma_pago`.`fp_id` not in (1,6)) and (`cobro_cliente`.`cobro_monto_total` <> 0))) union (select 'Retiro Cheque' AS `categoria`,concat('Cheque ',`cheque`.`cheque_id`,' por <b>','retiro','</b>',' - ') AS `concepto`,`cheque`.`cheque_modificacion_fh` AS `fecha`,concat('Retirado por ',`usuario`.`usua_nombre`) AS `nombre`,`cheque`.`cheque_monto` AS `monto`,'Cheque retirado' AS `observacion`,`cheque`.`cheque_id` AS `id`,'Cheque' AS `forma_pago`,concat('RCH',`cheque`.`cheque_id`) AS `op_id`,'6' AS `fp_id` from (`cheque` join `usuario` on((`usuario`.`usua_id` = `cheque`.`cheque_salida_caja_usua_id`))) where (`cheque`.`cheque_estado` = 11)) order by `fecha` ;

